import styled from 'styled-components';
import Pesquisa from '../components/Pesquisa';

const AppContainer = styled.div`
	width: 100vw;
	height: 100vw;
	background-image: linear-gradient(90deg, #002F52 35%, #326589);
`
function Favoritos() {
  return (
		<AppContainer>
			<Pesquisa />
    </AppContainer>
  );
}

export default Favoritos;
